import React, { Component } from 'react'
import style from './index.module.css';

import SummaryInfo from '../SummaryInfo';

export default class Msg extends Component {
  render() {
    return (
      <div className={[style.msg, 'col-sm-12', 'container'].join(' ')}>
        <SummaryInfo />
        <button className={[
          style.deleteBtn, 'col-sm-2', 'btn', 'btn-default'].join(' ')}>删除</button>
      </div>
    )
  }
}
